&quot;<a title="Limp Bizkit &ndash; N 2 Gether Now" href="http://www.last.fm/music/Limp+Bizkit/_/N+2+Gether+Now" class="bbcode_track">N 2 Gether Now</a>&quot; is a song by <a href="http://www.last.fm/tag/nu%20metal" class="bbcode_tag" rel="tag">nu metal</a> band <a href="http://www.last.fm/music/Limp+Bizkit" class="bbcode_artist">Limp Bizkit</a>. It was released as the third single in their second album <a title="Limp Bizkit - Significant Other" href="http://www.last.fm/music/Limp+Bizkit/Significant+Other" class="bbcode_album">Significant Other</a>. It was released alongside their last single &quot;<a title="Limp Bizkit &ndash; Break Stuff" href="http://www.last.fm/music/Limp+Bizkit/_/Break+Stuff" class="bbcode_track">Break Stuff</a>.&quot;

 The song features rapper <a href="http://www.last.fm/music/Method+Man" class="bbcode_artist">Method Man</a> and producer <a href="http://www.last.fm/music/DJ+Premier" class="bbcode_artist">DJ Premier</a>, who made additional beats for the song.

